import React from "react";
import s from "./Days.module.scss"; // с большой буквы
import { Day } from "./Days";
import { GlobalSwgSelector } from "../../../../assets/icons/global/GlobalSwgSelector";


interface Props {
    day:Day 
}


export const Card = ({day, day_info, icon_id, temp_day, temp_night, info}: Day) => { 
  return <div className={s.card}>
    <div className={s.day}>{day}</div>
    <div className={s.day_info}>{day_info}</div>
    <div className={s.icon_id}>
    <div className={s.temp_night}></div>
    
        <GlobalSwgSelector id={icon_id}/>
    </div>
    <div className={s.temp_day}>{temp_day}</div>
    <div className={s.temp_night}>{temp_night}</div>
    <div className={s.info}>{day_info}</div>
  </div>
};
